import React from 'react';
import { Button } from '@material-ui/core';
import { Link } from 'react-router-dom';
import styles from './ProfileAdmin.module.scss';
const ProfileAdmin = () =>{
    return(
        <div className={styles.box}>
            <h2>Xin chào Admin!</h2>
            <div className={styles.functionality}>
                <h3>Các tính năng của dashboard!</h3>
                <div className={styles.users}>
                    <p>Chỉnh sửa User (khóa, thay đổi thông tin)</p>
                    <Link to='/admin/dashboard/user'><Button variant='contained'>User</Button></Link>
                </div>
                <div className={styles.users}>
                    <p>Quản lý bài viết, sửa, thêm mới</p>
                    <Link to='/admin/dashboard/tin-tuc'><Button variant='contained'>Tin Tức</Button></Link>
                </div>
                <div className={styles.users}>
                    <p>Đăng ký tài khoản admin mới</p>
                    <Link to='/admin/dashboard/dang-ky'><Button variant='contained'>Đăng Ký</Button></Link>
                </div>
            </div>
        </div>
    )
}

export default ProfileAdmin;
